import React from "react";
import Entry from "./Entry";
import emojipedia from "../emojipedia";

function App() {
  return (
    <div>
      <h1>
        <span>emojipedia</span>
      </h1>
      <Entry emoji={emojipedia[0].emoji} name={emojipedia[0].name} meaning={emojipedia[0].meaning} />
      <Entry emoji={emojipedia[0].emoji} name={emojipedia[0].name} meaning={emojipedia[0].meaning} />
      <Entry emoji={emojipedia[0].emoji} name={emojipedia[0].name} meaning={emojipedia[0].meaning} />
    </div>
  );
}

export default App;
